import styled from 'styled-components';
const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100%;
  background-color: #f8f5ec;
  padding: 0.1px;
  position: relative;

`;
const Bg404 = styled.div`
  width: 800px;
  height: 600px;
  background-image: url(http://p3.qhimg.com/t01f0e8e8d8b962b3a2.jpg);
  background-size: 100% 100%;
  position: absolute;
  top: 50%;
  margin-top: 100px;
  left: 50%;
  margin-left: -400px;
  box-sizing: border-box;
`;
class NotFound extends Component {
  render() {
    return (
      <Wrapper>

        <Bg404 />
      </Wrapper>
    )
  }
}

export default NotFound;
